import { Typography, Button, TextField } from '@mui/material'

export const SearchPage = () => {
    return (
        <div>
            <Typography variant='h6'>
                Enter Your Search Term
            </Typography>
            <TextField id="outlined-basic" label="Outlined" variant="outlined" />
        </div>
    )

}
